    "2016-07-27T22:42:14.273026",nt"name": "organochlorine-pesticides-and-their-effects-on-reproduction-of-snowy-egret-nesting-on-lake",nt"isopen":
    false,nt"url": null,nt"notes": "The objectives of this investigation were:
    1) to assess any trends in contaminant concentrations in snowy egret eggs in populations
    for Lake Apopka and St. Marks NWR; 2) to determine if snowy egret reproduction is
    being affected by a mixture of organochlorine pesticides, metals, and PAHs at Lake
    Apopka and St. Marks NWR. Interestingly, hatch rates of Lake Apopka clutches were
    positively associated with u00d3DDTx (r2 = 0.12, p < 0.05), while hatch rates of
    St. Marks clutches were not associated with any of the contaminant groups in the
    model. Eggshell thickness for clutches from Lake Apopka and St. Marks NWR were not
    associated with (sum)DDTx, (sum)cyclodienes, (sum)PCBs, mirex, major toxic metals,
    essential metals with toxic potential, and relatively nontoxic metals. The paucity
    of associations between DDE egg concentrations and eggshell thinning may be related
    to species specific factors, as snowy egrets have been suggested to have intermediate
    sensitivity to the eggshell thinning effects of DDE. Although 36 of 50 Lake Apopka
    clutches exceeded the trigger values for egg concentrations of (sum)DDTx and 13
    of 50 clutches exceeded the trigger values for u00d3chlordanes, no significant differences
    were detected between the two groups with respect to fecundity, eggshell thickness,
    and hatch rates. Therefore, we suggest the trigger values may be overly conservative,
    but appear to be protective of fish-eating birds.",nt"license_title": "License
